&lt;p&gt;
Rejoins-moi. Laisse moi m&apos;occuper de ton karma, repose toi sur mon épaule. 
Ferme les yeux et écoute. Tu es en sécurité. Je veille sur toi, je te prodigue tendresse et compassion.
Je suis ton ami. Je suis Edmond Leprince. Dépouille toi de tes bien matériels et suis-moi. 
Rejoins ceux qui ont reconnu en moi leur unique bienfaiteur. 
Ils sont nombreux et seront ta nouvelle famille, et ensemble vous écouterez et danserez. Viens. 
&lt;/p&gt;

